import React from 'react';

function GapList({ gaps, onSelectGap }) {
  return (
    <ul>
      {gaps.map((gap) => (
        <li key={`${gap.ticker}-${gap.date}`} onClick={() => onSelectGap(gap)}>
          {gap.ticker} - {gap.date} - Gap: {gap.gap_percent}% 
          {gap.return_did_close && (
            <span style={{ color: 'red' }}> - Return Did Close</span>
          )}
        </li>
      ))}
    </ul>
  );
}

export default GapList;
